import React, { useState, useEffect } from "react";
import "./VotingBox.css";

function VotingBox({ votes, toggleVoteModal, setVotes }) {
  const [expandedVoteIndex, setExpandedVoteIndex] = useState(null);
  const [showAllVotes, setShowAllVotes] = useState(false); // Show only the latest vote by default
  const [voteCounts, setVoteCounts] = useState([]);
  const [userVotes, setUserVotes] = useState({});

  // Set the latest vote as the default only on the initial load
  useEffect(() => {
    if (votes.length > 0 && expandedVoteIndex === null) {
      setExpandedVoteIndex(votes.length - 1);
    }
  }, [votes]);

  const handleToggleShowAllVotes = () => {
    setShowAllVotes(!showAllVotes);
    if (!showAllVotes) {
      setExpandedVoteIndex(votes.length - 1); // Reset to latest vote when toggling back
    }
  };

  const handleVoteClick = (index) => {
    setExpandedVoteIndex(index);
  };

  const handleVote = (voteIndex, answerIndex) => {
    if (userVotes[voteIndex] !== undefined) {
      alert("Už ste hlasovali!");
      return;
    }

    const updatedVoteCounts = [...voteCounts];
    if (!updatedVoteCounts[voteIndex]) {
      updatedVoteCounts[voteIndex] = new Array(
        votes[voteIndex].answers.length
      ).fill(0);
    }

    updatedVoteCounts[voteIndex][answerIndex] += 1;
    setVoteCounts(updatedVoteCounts);

    const updatedUserVotes = { ...userVotes, [voteIndex]: answerIndex };
    setUserVotes(updatedUserVotes);
  };

  return (
    <div className="voting-box">
      <div className="voting-header">
        <h3>Posledné hlasovanie</h3>
        <button className="add-btn" onClick={toggleVoteModal}>
          <img src="./Add.svg" alt="Add Vote" className="add-icon" />
        </button>
        <button className="list-btn" onClick={handleToggleShowAllVotes}>
          {showAllVotes ? "Zobraziť posledné" : "Zobraziť všetky"}
        </button>
      </div>
      <hr />

      {showAllVotes
        ? votes.map((vote, voteIndex) => (
            <div key={voteIndex}>
              <h4
                onClick={() => handleVoteClick(voteIndex)}
                className="vote-title"
              >
                {vote.title}
              </h4>
              {expandedVoteIndex === voteIndex && (
                <div>
                  <p>{vote.description}</p>
                  <ul className="voting-results">
                    {vote.answers.map((answer, answerIndex) => (
                      <li key={answerIndex}>
                        <button
                          onClick={() => handleVote(voteIndex, answerIndex)}
                          disabled={userVotes[voteIndex] !== undefined}
                        >
                          {answer}
                        </button>
                        <span>
                          {voteCounts[voteIndex]?.[answerIndex] || 0} hlasov
                        </span>
                      </li>
                    ))}
                  </ul>
                </div>
              )}
            </div>
          ))
        : votes.length > 0 &&
          votes[expandedVoteIndex] && (
            <div>
              <h4 className="vote-title">{votes[expandedVoteIndex].title}</h4>
              <div>
                <p>{votes[expandedVoteIndex].description}</p>
                <ul className="voting-results">
                  {votes[expandedVoteIndex].answers.map(
                    (answer, answerIndex) => (
                      <li key={answerIndex}>
                        <button
                          onClick={() =>
                            handleVote(expandedVoteIndex, answerIndex)
                          }
                          disabled={userVotes[expandedVoteIndex] !== undefined}
                        >
                          {answer}
                        </button>
                        <span>
                          {voteCounts[expandedVoteIndex]?.[answerIndex] || 0}{" "}
                          hlasov
                        </span>
                      </li>
                    )
                  )}
                </ul>
              </div>
            </div>
          )}
      {votes.length === 0 && <p>Žiadne hlasovanie ešte nebolo pridané.</p>}
    </div>
  );
}

export default VotingBox;
